import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import Typewriter from 'typewriter-effect';

const header1 = 'Your passwords aren\'t as secure as you think they are.'
// const header2 = 'as you think they are.'
const subheader1 = ' However, we can fix that.'

function TypewriterComponent (props) {
    return (
        <Typewriter
            options={{
                delay: 60,
            }}
            onInit={(typewriter) => {
                typewriter
                    .pauseFor(0)
                    .typeString(props.string1)
                    .pauseFor(props.delay)
                    .typeString(props.string2)
                    .start();
            }}
        />
    )
}


function App () {
    return (
        <div>
            <div class='OpeningHeader'>
                <TypewriterComponent string1={header1} delay='5000' string2={subheader1}  />
            </div>
            {/* <div class='SubHeader'>
                <TypewriterComponent string={subheader1} delay='5000' />
            </div> */}
        </div>
        )
    }

ReactDOM.render(
    <App />,
    document.getElementById('app')

)
